import React from 'react'
import { Row , Col} from 'antd';
import { map } from 'rxjs/operators';


const products = () => {
    return (
        <>
            <h1>Latest products</h1>
            <Row>

            
                {products.map(product => (
                    <Col sm={12} md={6} lg={3}>
                    <h3>{product.name}</h3>
                </Col>
                ))}
            </Row>
            
            
        </>
    )
}

export default products
